import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import Services from '../../container/services/services';
import Banner from '../../container/banner/banner';
import './category_component.css';
class CategoryContent extends Component

 {
  render() {
    return (
   <div id="buyer_category_list">
     <Banner />
     <div class="buy_cat_list">
       <div class="container">
          <ul>
            <li class="col">
              <div class="box">
                <a href="javascript:;">
                  <img src="img/rohit/buy_cat_list1.jpg"/>
                  <video playsinline="playsinline" autoplay="autoplay" loop="">
                    <source src="https://res.cloudinary.com/dn3qy37yz/video/upload/v1560413667/v8_aijaau.mp4" type="video/mp4" />
                  </video>
                </a>
                <div class="clearfix"></div>
              </div>
            </li>
          </ul>
       </div>
       <div class="clearfix"></div>
     </div>
     <div class="clearfix"></div>
   </div>
    );
  }
}
export default CategoryContent;
